describe('image Cropping', () => {
    let editor: DocumentEditor;
    let documentHelper: DocumentHelper;
    let exportData: any;
    let data: any;
    beforeAll((): void => {
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        DocumentEditor.Inject(SfdtExport);
        editor = new DocumentEditor({ enableSfdtExport: true });
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
        documentHelper = editor.documentHelper;
        editor.open(JSON.stringify(crop));
        exportData = JSON.parse(editor.sfdtExportModule.serialize());
        editor.open(JSON.stringify(uncrop));
        data = JSON.parse(editor.sfdtExportModule.serialize());
    });
    afterAll((done): void => {
        documentHelper.destroy();
        documentHelper = undefined;
        editor.destroy();
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        setTimeout(function () {
            done();
        }, 1000);
    });
    it('crop ', () => {
console.log('crop ');
        let ecrop: any = exportData.sections[0].blocks[0].inlines[0];
        expect(ecrop.iscrop).toBe(true);
        expect(ecrop.width).toBe(175);
        expect(ecrop.right).toBe(47.97);
        expect(ecrop.height).toBe(97);
    });
});
describe('image uncrop', () => {
    let editor: DocumentEditor;
    let documentHelper: DocumentHelper;
    let data: any;
    beforeAll((): void => {
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        DocumentEditor.Inject(SfdtExport);
        editor = new DocumentEditor({ enableSfdtExport: true });
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
        documentHelper = editor.documentHelper;
        editor.open(JSON.stringify(uncrop));
        data = JSON.parse(editor.sfdtExportModule.serialize());
    });
    afterAll((done): void => {
        documentHelper.destroy();
        documentHelper = undefined;
        editor.destroy();
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        document.body.innerHTML = '';
        setTimeout(function () {
            done();
        }, 1000);
    });
    it('uncrop', () => {
console.log('uncrop');
        let euncrop: any = data.sections[0].blocks[0].inlines[0];
        expect(euncrop.width).toBe(468);
        expect(euncrop.height).toBe(263.25);
        expect(euncrop.horizontalposition).toBe(undefined);
		expect(euncrop.bottom).toBe(undefined);
		expect(euncrop.iscrop).toBe(false);
    });
});
