describe('image cropping missing bounds', () => {
    let editor: DocumentEditor;
    let documentHelper: DocumentHelper;
    let data: any;
    beforeAll((): void => {
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        DocumentEditor.Inject(SfdtExport);
        editor = new DocumentEditor({ enableSfdtExport: true });
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
        documentHelper = editor.documentHelper;
        editor.open(JSON.stringify(uncrop));
    });
    afterAll((done): void => {
        documentHelper.destroy();
        documentHelper = undefined;
        editor.destroy();
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        document.body.innerHTML = '';
        setTimeout(function () {
            done();
        }, 1000);
    });
	it('Source rect missing left, right, top, bottom', () => {
		console.log('Source rect missing left, right, top, bottom');
		editor.open(JSON.stringify(cropMissingBounds));
		//Image with top crop
		let lineWidget: any = editor.documentHelper.pages[0].bodyWidgets[0].childWidgets[1] as LineWidget;
		let imageElement: ImageElementBox = lineWidget.childWidgets[0].children[0] as ImageElementBox;
		expect(imageElement.cropX).toBe(0)
		expect(imageElement.cropY).toBe(27.002599477767944);
		expect(imageElement.cropHeight).toBe(342.99740052223206);
		expect(imageElement.cropWidth).toBe(378);
		//Image with right crop
		lineWidget = editor.documentHelper.pages[0].bodyWidgets[0].childWidgets[3] as LineWidget;
		imageElement = lineWidget.childWidgets[0].children[0] as ImageElementBox;
		expect(imageElement.cropX).toBe(0)
		expect(imageElement.cropY).toBe(0);
		expect(imageElement.cropHeight).toBe(370);
		expect(imageElement.cropWidth).toBe(341.99927936553956);
		//Image with bottom crop
		lineWidget = editor.documentHelper.pages[1].bodyWidgets[0].childWidgets[0] as LineWidget;
		imageElement = lineWidget.childWidgets[0].children[0] as ImageElementBox;
		expect(imageElement.cropX).toBe(0)
		expect(imageElement.cropY).toBe(0);
		expect(imageElement.cropHeight).toBe(345.00279984474184);
		expect(imageElement.cropWidth).toBe(378);
		//Image with left crop
		lineWidget = editor.documentHelper.pages[1].bodyWidgets[0].childWidgets[2] as LineWidget;
		imageElement = lineWidget.childWidgets[0].children[0] as ImageElementBox;
		expect(imageElement.cropX).toBe(38.000341701507566)
		expect(imageElement.cropY).toBe(0);
		expect(imageElement.cropHeight).toBe(370);
		expect(imageElement.cropWidth).toBe(339.9996582984924);
	});
});
